import '../css/NavBar.css'
 class NavBar extends React.Component{
    // constructor(props){
    //     super(props);
    // }

    handleScroll = e => {
        let element = e.target
        if (element.scrollHeight - element.scrollTop === element.clientHeight) {
          console.log('HELLO');
        }
      }
    render(){
        return (
            <div className ='nav-bar' onScroll={this.handleScroll} >
                <div className='logo-button'>
                    <button>
                    <a href='http://localhost:3000/' target='_top'>
                    <img className='logo' src='assert/navBar/logo.png' alt='logo'></img>
                    </a>
                    </button>
                </div>
                <div className='nav-button'>
                    <a>
                        .01 Somethings
                    </a>
                    <a>
                        .02 Somethings
                    </a>
                    <a>
                        .03 Somethings
                    </a>
                    <a>
                        .04 Somethings
                    </a>
                    <button className='resume-button'>
                        <a>
                            Resume
                        </a>
                    </button>
                </div>
                <div className='expanse-button'>
                    <button>
                        <img className='logo' src='assert/navBar/expanse.png' alt='expanse'></img>
                    </button>
                </div>
            </div>
        );
    }


};

export default NavBar;
